import { Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home members={members} />} />
        <Route path="/customer/:id" element={<Customer array={members} />} />
        <Route path="/company/:id" element={<Company array={members} />} />
      </Routes>
    </div>
  );
}

export default App;
